/*!

=========================================================
* Paper Kit React - v1.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/paper-kit-react

* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/paper-kit-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";

// reactstrap components
import { Button, Card, Form, Input, Container, Row, Col } from "reactstrap";

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";

function submitForm(formValue) {
  alert("Very nice")
}

function RegisterPage() {
  document.documentElement.classList.remove("nav-open");
  React.useEffect(() => {
    document.body.classList.add("register-page");
    return function cleanup() {
      document.body.classList.remove("register-page");
    };
  });
  return (
    <>
      <ExamplesNavbar />
      <div
        className="page-header"
        style={{
          backgroundImage: "url(" + require("assets/img/grid_neon2.png") + ")",
        }}
      >
        <div className="" />
        <Container>
          <Row>
            <Col className="ml-auto mr-auto" lg="4" >
                <h3 style={{textAlign:'center', fontWeight:'bolder'}} className="title mx-auto">Welcome to Traffic Jammer</h3>
                <Form className="register-form" color="primary" action={val => submitForm()}>
                  <label>Email</label>
                  <Input placeholder="Email" type="text" />
                  <label>Password</label>
                  <Input placeholder="Password" type="password" value=""/>
                  <input type="submit" block className="btn-round" text="Login" color="primary">
                  </input>
                </Form>
                <div className="forgot">
                  <Button
                    className="btn-link"
                    color="primary"
                    href="/index"
                  >
                    Forgot password?
                  </Button>
                </div>
            </Col>
          </Row>
        </Container>
        <div className="footer register-footer text-center">
        </div>
      </div>
    </>
  );
}

export default RegisterPage;
